import { useEffect } from "react";
import axios from 'axios';




export default function VideoList()
{
    useEffect(async()=>{
        await axios({
            method:'get',
            url:'/videoFs/getAllVideos',
            headers: {'Content-Type': 'multipart/form-data'},
        })
        .then(res=>res.data)

    })


    return<div>

    </div>
}
